import React from 'react';
import { Avatar, Box, Grid, Typography } from '@mui/material';
import { makeStyles } from '@mui/styles';
import myPic from '../../assets/minha foto.jpeg';

export const PresentationPage = () => {
   const styles = makeStyles({
      container: {
         backgroundColor: "rgba(0, 145, 136, 0.8)",
         paddingTop: "10%",
         paddingLeft: "10%",
         paddingRight: "10%",
      },
      firstText: {
         fontFamily: "Noto Sans",
         fontWeight: 500,
         fontSize: "32px",
      },
      secondText: {
         fontFamily: "Noto Sans",
         fontWeight: 800,
         fontSize: "62px",
         textAlign: "end"
      },
      thirdText: {
         fontFamily: "Noto Sans",
         fontWeight: 700,
         fontSize: "38px",
         textAlign: "end",
      },
   })
   
   return (
      <Box className={styles.container}>
         <Grid container direction="column">
            <Grid item>
               <Grid container direction="row">
                  <Grid item>
                     <Typography className={styles.firstText}>
                        Olá! Eu sou Bianca Sakaniwa, uma
                     </Typography>
                  </Grid>
                  <Grid item>
                     <Avatar src={myPic} variant="circular" />
                  </Grid>
               </Grid>
            </Grid>
            <Grid item sx={{ paddingTop: "10%" }}>
               <Typography className={styles.secondText}>
                  Desenvolvedora de Software Fullstack
               </Typography>
            </Grid>
            <Grid item>
               <Typography className={styles.thirdText}>
                  Com ênfase em front-end
               </Typography>
            </Grid>
         </Grid>
      </Box>
   )
}
